Okay, let's break down the ultimatum game from the responder's perspective and build a computational model.

**1. Psychological Mechanisms:**

*   **Fairness:** Responders evaluate the fairness of the offer. This isn't strictly about absolute monetary value; it's about the perceived equity of the split, potentially influenced by relative contributions.
*   **Inequity Aversion:** People dislike unequal outcomes, both when they are disadvantaged (receiving less) and sometimes when they are advantaged (receiving more).
*   **Social Norms:** Responders might have an internal standard of what a "fair" split looks like. Offers that deviate significantly are more likely to be rejected.
*   **Punishment:** Rejecting an offer, even at a personal cost (receiving nothing), can be seen as punishing the proposer for making an unfair offer.
*   **Loss Aversion:** Responders might frame the offer in terms of potential loss relative to what they perceive as a fair share.

**2. Interactions:**

*   Fairness acts as a baseline. The perceived utility of the offer is directly related to the degree of the fairness of the split.
*   Inequity aversion modulates the utility, penalizing both advantageous and disadvantageous inequity, though likely asymmetrically. Disadvantageous inequity (receiving less) is penalized more strongly.
*   Social norms create a reference point against which the offer is judged. The further the offer deviates from this norm, the stronger the emotional response (positive or negative).
*   Loss aversion amplifies the negative utility associated with receiving less than the perceived fair share.

**3. Mathematical Form:**

Given the above considerations, I think a utility function that incorporates fairness, inequity aversion, and potentially some base acceptance bias will work best. I'll use a hyperbolic tangent function to ensure that the output is between 0 and 1.

Here's a possible utility function, building on the existing variables:

*   **Baseline Utility:** A base preference to accept.
*   **Fairness Component:** A term that increases with the proportion of the total earning offered to the responder.
*   **Inequity Aversion:** A penalty term that increases with the absolute difference between the offered proportion and the responder's perceived fair share, weighted by a sensitivity parameter.
*   **Error Term:** A random variable that will account for any other unmeasured features.

**4. Parameters:**

*   `base_acceptance`: A constant reflecting a prior bias to accept any offer (constrained between 0 and 1).
*   `fairness_sensitivity`: Scales the impact of the offered proportion on utility (non-negative).
*   `inequity_aversion`: Weighting parameter for the inequity aversion component (non-negative).

