*   `split_perc_self`: Percentage of money offered to self.
*   `trial_type`: How much was the contribution [1 = equal, 2 = opponent more, 3 = participant more]
*   `token_self`: Number of tokens found by participant.
*   `token_opp`: Number of tokens found by the opponent.

Okay, with all that in mind, here's the model specification:

